use tienda;

delimiter //
DROP FUNCTION IF EXISTS nombreProd;
CREATE
	FUNCTION nombreProd(cod INT) RETURNS int
	BEGIN
        declare cont int;
		set count = 0;
        select count(*)
        into cont
        from compras
        where producto_id = cod and created_at > '2022-09-22T00:00:01';
        
    	RETURN cont;
    END;//
delimiter ;

select nombreProd(2);





select A.nombre, count(B.id)
from productos A, tarifas B
where A.codigo = B.producto_id
group by A.codigo;

select codigo
from productos
where codigo not in (select producto_id from tarifas);

select * from productos;
delete from productos where id = 2;

select * from ventas where created_at > '2022-09-22';
select * from compras;
